$(document).on('click', '#user_logout', function (e) {
  e.preventDefault();
  Swal.fire({
    title: 'Are You Sure!',
    text: 'You want to logout?',
    // icon: 'warning',
    imageUrl: 'uploads/media/2024/sherosparks-logout.png', 
    imageWidth: 100, 
    showCancelButton: true,
    confirmButtonColor: '#8b285d',
    cancelButtonColor: '#F0F0F8',
    cancelButtonText: '<span style="color: #383838;">Cancel</span>',
    confirmButtonText: 'Yes',
    showLoaderOnConfirm: true,
    preConfirm: function () {
      return new Promise((resolve, reject) => {
        $.ajax({
          type: 'POST',
          url: base_url + 'login/logout',
          data: { [csrfName]: csrfHash },
          dataType: 'json',
          success: function (response) {
            csrfName = response.csrfName;
            csrfHash = response.csrfHash;
            resolve();
            // Swal.fire('Success', 'Logout successfully!', 'success');
            Swal.fire({
              title: 'Success',
              text: 'Logout successfully!',
              imageUrl: 'uploads/media/2024/sherosparks-logout-success.png', // Add your custom image URL here
              imageWidth: 100, // Adjust the width of the image as needed
              showConfirmButton: false, // Optionally hide the confirm button
              timer: 600 
            }).then(() => {
              // Reload the page after the alert is closed
              window.location.reload();
            });
            
            
            // setTimeout(function () {
            //   window.location.reload();
            // }, 600);
          },
          error: function (xhr, status, error) {
          console.error('Logout failed:', status, error); // Log the error details
          console.error('Response:', xhr.responseText); // Log the response text
          reject(error);
          Swal.fire('Error', 'Logout failed!', 'error');
          }
        });
      });
    },
    allowOutsideClick: false,
  }).then((result) => {
    if(result.dismiss===Swal.DismissReason.cancel){
      // Show cancelled message with custom image 
      // const cancelButtonImage = 'path/to/your/cancelled-image.png'; // Replace path accordingly 
      Swal.fire({
      title:'Cancelled',
      text:'You have not logged out',
      // icon:'error',
      imageUrl: 'uploads/media/2024/sherosparks-cancelled.png', 
      imageWidth: 100, 
      // imageUrl :cancelButtonImage,
      // imageWidth :100 ,
      // imageHeight :100 ,
      // imageAlt :'Custom Cancelled Image'
      });
      setTimeout(()=>{
      const okButtons=document.querySelectorAll('.swal2-confirm');
      okButtons.forEach(button=> {
      button.classList.add('custom-ok-button');
      // Optionally remove previous styles if necessary 
      button.removeAttribute("style");
      });
      },500); // Delay applying custom class by half-second
      }
  });
});

