$(document).on('click', '.compare', function (e) {
  e.preventDefault();
  var t = $(this).attr('data-product-id');
  var i = $(this).attr('data-product-variant-id');
  var e = { product_id: t.trim(), product_variant_id: i.trim() };
  var i = localStorage.getItem('compare');
  Toast.fire({ icon: 'success', title: 'products added to compare list' });
  if ((i = i !== null ? JSON.parse(i) : null) == null) {
    i = [e];
  } else {
    if (i.find((e) => e.product_id === t)) {
      Toast.fire({
        icon: 'error',
        title: 'This item is already present in your compare list',
      });
      return;
    }
    i.push(e);
  }
  localStorage.setItem('compare', JSON.stringify(i));
  e = i.length || '';
  $('#compare_count').text(e);
  if (i !== null && e <= 1) {
    Toast.fire({
      icon: 'warning',
      title: 'Please select 1 more item to compare',
    });
    return false;
  }
});
$(document).on('click', '.remove-compare-item', function (e) {
  e.preventDefault();
  var t = $(this).attr('data-product-id');
  if (confirm('Are you sure want to remove this?')) {
    e = $('#compare_count').text();
    e--;
    $('#compare_count').text(e);
    if (e < 1) {
      $(this).parent().parent().remove();
      location.reload();
    } else {
      $(this).parent().parent().remove();
    }
    if (
      (e =
        (e = localStorage.getItem('compare')) !== null ? JSON.parse(e) : null)
    ) {
      e = e.filter(function (e) {
        return e.product_id != t;
      });
      localStorage.setItem('compare', JSON.stringify(e));
      display_compare();
    }
  }
});
$(document).on('click', '.compare-removal button', function (e) {
  e.preventDefault();
  var t = $(this).attr('data-product-id');
  var i = $(this).parent().parent().parent();
  if (confirm('Are you sure want to remove this?')) {
    localStorage.removeItem('compare');
    location.reload();
    i = localStorage.getItem('compare');
    if ((i = localStorage.getItem('compare') !== null ? JSON.parse(i) : null)) {
      e = i.filter(function (e) {
        return e.id != t;
      });
      localStorage.setItem('compare', JSON.stringify(e));
      if (i) {
        display_compare(e);
      }
    }
  }
});
